import React from "react";

export const RecentFile = ({ type, icon: Icon }) => {
  return (
    <div className="p-2 grid grid-cols-5 bg-white rounded-2xl">
      <div>
        <span
          className={`bg-purple-500/90 text-lg p-2 rounded aspect-square w-fit flex justify-center items-center`}
        >
          <Icon />
        </span>
        <span>{type.name}</span>
      </div>
    </div>
  );
};
